// ==UserScript==
// @name         Collager
// @namespace    Empornium Scripts
// @version      1.1.2
// @description  Add title to your favorite collage from title page
// @author       vandenium
// @include     /^https://www\.empornium\.(me|sx|is)\/torrents.php\?id=*/
// @icon         https://www.google.com/s2/favicons?sz=64&domain=empornium.is
// @require      https://cdnjs.cloudflare.com/ajax/libs/crypto-js/4.1.1/crypto-js.min.js
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/455963/Collager.user.js
// @updateURL https://update.greasyfork.org/scripts/455963/Collager.meta.js
// ==/UserScript==
//
// Instructions:
//  - Install userscript in your userscript manager.
//  - Get passphrase from thread and enter below, search for "passphrase".
//  - Refresh torrent page
//  - "Add Title To Collage" button will appear at top of title page.
//
// Changelog:
// Version 1.1.2, 2025-06-23
//  - Collage data update
// Version 1.1.1
//  - Collage data update
// Version 1.1.0
//  - Collage data update.
// Version 1.0.0
//  - The initial version.
//  - Features
//    - Add torrent to a selected collage via "Add Title to
//      Collage" button on the title page.
//    - Embedded, encoded collage data for performance.
//    - Tested in:
//      -  Chrome, Brave
//      -  Tampermonkey, Violentmonkey
//    - Works across [b].is[/b], [b].sx[/b], [b].me[/b].
// Future Features:
//    - Each user downloads/refreshes their own collage data.
//    - Add passphrase dialog/setting from UI.
//    - [Esc], click outside dialog closes dialog.
//
(async function () {
  // Enter the passphrase here, see the Collager userscript thread.
  const PASSPHRASE = '<Enter passphrase here>';

  const collageDataEnc = '';
  let collageData;

  try {
    const bytes = CryptoJS.AES.decrypt(collageDataEnc, PASSPHRASE);
    collageData = JSON.parse(bytes.toString(CryptoJS.enc.Utf8));
  } catch (e) {
    alert('Collager - Either the passphrase is incorrect or you haven\'t set it yet. See the installation instructions in thread.');
    return false;
  }

  const template = `
     <style>
       h3 {
         display: inline-block;
         margin-left: 260px;
         color: #ccc;
       }
       #cqa-close-icon {
         float: right;
         margin: 5px;
       }

       #cqa-close-icon:hover {
         cursor: pointer;
       }

       #collage-quick-add-outer {
          width: 500px;
          height: 310px;
       }
       #collage-quick-add-inner {
          width: 700px;
          height: 450px;
          border: solid #ccc 1px;
          background-color: #333;
          position:fixed;
          left:50%;
          top:50%;
          transform: translate(-50%, -50%);
          z-index:2;
       }
       #cqa-results {
         width: 81%;
         height: 50%;
         border: solid #666 1px;
          margin: 5px auto;
          padding: 10px;
          position: relative;
          overflow: auto;

       }
       .cqa-collage-item {
          display: inline-block;
          margin: 0 3px 3px 0;
          background-color: #2a111d;
          padding: 3px;
          border-radius: 5px;
          border: solid #666 1px;
          color: #ccc;
       }
       .cqa-collage-item.selected:before {
          content: "";
       }
       .cqa-collage-item.selected {
          background-color: #a0ffb2;
          color: #111;
       }
       .cqa-collage-item:hover {
         cursor: pointer;
         background-color: #a0ffb2;
         color: #111;
       }
       #cqa-searchbox {
          width: 83%;
          margin: 3px auto;
          border-radius: 5px;
          display: block;
          background-color: #333;
          color: #e8e8e8;
       }
       button {
        margin: 3px auto;
        width: 84%;
        display: block;
        height: 25px;
       }
       button:hover {
         cursor: pointer;
       }

       #cqa-message-area {
        width: 83%;
        margin: 0 auto;
        border: solid #666 1px;
        margin: 5px auto 5px auto;
        padding: 3px;
        color: #ccc;
       }

       .msg-area-msg {
          border: solid #ccc 1px;
    height: 1em;
    padding: 4px;
    width: 573px;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    display: inline-block;
    background-color: #a0ffb2;
    color: #111;
    border-radius: 5px;
       }
     </style>
     <div id='collage-quick-add-outer'>
       <div id='collage-quick-add-inner'>
       <h3>Add Title To Collage</h3><span id='cqa-close-icon'></span>
       <input type='text' id='cqa-searchbox' placeholder='Type here to search for collage'></input>
       <div id='cqa-results'></div>
       <div id="cqa-message-area"></div>
       <button disabled id='cqa-add-to-collage' type="button">Add Title To Collage</button>
       </div>
     </div>
  `;

  const updateMessageArea = (collageItem) => {
    const torrentTitle = document.querySelector('h2').innerText;
    const msgArea = document.querySelector('#cqa-message-area');
    msgArea.innerHTML = `Add title: <span class='msg-area-msg'>${torrentTitle}</span><br/>to collage: <span class='msg-area-msg'>${collageItem ? collageItem.name : ''}</span>`;
  };

  let selectedCollageEl = null;

  const renderCollageItem = (collageItem) => {
    const container = document.createElement('span');
    container.classList.add('cqa-collage-item');
    container.innerText = collageItem.name;
    container.dataset.id = collageItem.id;

    // Add event listener
    container.addEventListener('click', () => {
      if (selectedCollageEl) {
        selectedCollageEl.classList.remove('selected');
      }
      container.classList.add('selected');
      selectedCollageEl = container;

      // Fire event to enable the button
      const event = new Event('enable-cqa-button');
      container.parentElement.dispatchEvent(event);

      // update message area
      updateMessageArea(collageItem);
    });
    return container;
  };

  const getAddTorrentToCollageForm = async (collageId) => fetch(`/collage/${collageId}`)
    .then((response) => response.text())
    .then((htmlString) => {
      const parser = new DOMParser();
      const doc = parser.parseFromString(htmlString, 'text/html');
      const formEl = doc.querySelector('#addtorrent form');
      return formEl;
    });

  const renderSearchedItems = (textInput) => collageData
    .filter((collageItem) => collageItem.name.toLowerCase().includes(textInput.toLowerCase()))
    .map((collageItem) => renderCollageItem(collageItem));

  const getCurrentTorrentId = () => window.location.search.split('=')[1];

  function removeAllChildNodes(parent) {
    while (parent.firstChild) {
      parent.removeChild(parent.firstChild);
    }
  }

  const hideDialog = () => {
    const dialog = document.querySelector('#collage-quick-add-outer');
    dialog.remove();
  };

  async function addTorrentToCollage(torrentId, collageId) {
    const form = await getAddTorrentToCollageForm(collageId);

    // get input for torrent url
    const inputEl = form.querySelector('input[name=url]');
    inputEl.value = `/torrents.php?id=${torrentId}`;

    document.body.append(form);
    form.submit();
  }

  const showDialog = () => {
    const body = document.querySelector('body');
    const div = document.createElement('div');
    div.innerHTML = template.trim();
    const resultsArea = div.querySelector('#cqa-results');

    // close icon
    const closeIcon = div.querySelector('#cqa-close-icon');
    closeIcon.addEventListener('click', hideDialog);

    // Add button listener
    const addToCollageButtonEl = div.querySelector('#cqa-add-to-collage');

    resultsArea.addEventListener('enable-cqa-button', () => {
      addToCollageButtonEl.removeAttribute('disabled');
    });

    addToCollageButtonEl.addEventListener('click', () => {
      const currentTorrentId = getCurrentTorrentId();
      const collageId = selectedCollageEl?.dataset.id;
      if (currentTorrentId && collageId) {
        console.log(`Adding torrent ${currentTorrentId} to collage ${collageId}`);

        addTorrentToCollage(currentTorrentId, collageId);
      }
    });

    // Add searchbox eventListener
    const searchBoxEl = div.querySelector('#cqa-searchbox');
    searchBoxEl.addEventListener('keyup', () => {
      removeAllChildNodes(resultsArea);
      const foundItems = renderSearchedItems(searchBoxEl.value);
      foundItems.forEach((itemEl) => {
        resultsArea.append(itemEl);
      });
    });

    // Render all collages

    collageData.forEach((collageItem) => {
      resultsArea.appendChild(renderCollageItem(collageItem));
    });

    body.appendChild(div);

    // Update status area
    updateMessageArea();
  };

  function addOpenDialogButton() {
    const btn = document.createElement('a');
    btn.classList.add('button');
    btn.classList.add('blueButton');
    btn.innerText = 'Add Title To Collage';

    btn.addEventListener('click', () => {
      showDialog();
    });

    const container = document.querySelectorAll('.torrent_buttons')[1];
    container.appendChild(btn);
  }

  addOpenDialogButton();
}());
